static cssId(str){str=Helpers.replaceCodes(str);str=str.replace(/[^a-zA-Z0-9_\s-]/g,'-');str=str.replace(/[\s-]+/g,' ');str=str.trim();str=str.replace(/[\s_]/g,'-');return str.toLowerCase()}
